import { Button } from "antd";
import { useState } from "react";

function Favorite({ favoriteItems }) {
  const [displayDrawer, setDisplayDramer] = useState(false);
  const { videos, streams, clips } = favoriteItem;

  const onDrawerClose = () => {
    displayDrawer(false);
  };

  const onFavoriteDrawer = () => {
    setDisplayDramer(true);
  };

  return (
    <>
      <Button
        type="primary"
        shape="round"
        onClick={onFavoriteClick}
        icon={<StarFilled />}
      >
        My Favorite
      </Button>
      <Drawer
        title="My Favorite"
        placement="right"
        width={720}
        visible={displayDrawer}
        onClose={onDrawerClose}
      ></Drawer>
    </>
  );
}

export default Favorite;
